import React, { Component } from 'react';
import {Col, Row,Button, Modal,Input } from 'antd'; 
import './About.css'
import PropTypes from 'prop-types';
import GetViewPort from '../hoc-helpers/GetViewPort'

class MacroCalculator extends Component{ 

    render() { 




    const { width } = this.props; 

    if (width < 786) { 

    return( 

    <div className="page"> 

    </div> 

    ); 

    } 

    return( 

    <div className="page"> 
    <div className="form">
        <Col span={12}>
            Age:
            <Input placeholder="Enter your age here" />
        </Col>
        <Col>
            Weight:
            <Input placeholder="Enter your weight in lbs here" />
        </Col>
        <Col>
            Height:
            <Col>
                <Col span={12}><Input span={12} placeholder="Enter your Height in ft here" /></Col>
                <Col span={12}><Input span={12} placeholder="Enter your Height in inches here" /></Col>
            </Col>
         </Col>
         <Col span={12}>Image</Col>

    </div>
    </div> 

    ); 

    } 

    }; 

    MacroCalculator.propTypes = { 

    width: PropTypes.object, 

    }; 

    const MacroCalculatorWithHOC = GetViewPort(MacroCalculator) 

    export default MacroCalculatorWithHOC;
